TRANSFORMFIELD.EXPRESSION:
IIF(NBR_INCREMENT_DAYS=1,
		(IIF(PROCESS_TYPE='MONTHTODATE',MAKE_DATE_TIME(GET_DATE_PART(ADD_TO_DATE(:LKP.LKP_PROCESS_BATCH_CONTROL(PROCESS_NAME,'C'),'SS',1),'YYYY'),GET_DATE_PART(ADD_TO_DATE(:LKP.LKP_PROCESS_BATCH_CONTROL(PROCESS_NAME,'C'),'SS',1),'MM'),1,0,0,0),
		(IIF(LOAD_IND = 'C',ADD_TO_DATE(INCR_LOAD_END_TIME,'SS',1),
			(IIF(LOAD_IND = 'S' and TRUNC(PROCESS_START_TIME) != TRUNC(SYSDATE), ADD_TO_DATE(:LKP.LKP_PROCESS_BATCH_CONTROL(PROCESS_NAME,'C'),'SS',1),INCR_LOAD_START_TIME))
			))
		)),
		(IIF(LOAD_IND = 'C' AND CURRENT_JOB_IND = 'C' AND TRUNC(PROCESS_START_TIME) = TRUNC(SYSDATE),INCR_LOAD_START_TIME,
		(IIF(LOAD_IND = 'C' AND DATE_DIFF(ADD_TO_DATE(TRUNC(SYSDATE),'SS',-1),ADD_TO_DATE(INCR_LOAD_START_TIME,'DD',1),'DD')<=NBR_INCREMENT_DAYS+7,ADD_TO_DATE(INCR_LOAD_START_TIME,'DD',1),
			(IIF(LOAD_IND = 'C' AND DATE_DIFF(ADD_TO_DATE(TRUNC(SYSDATE),'SS',-1),ADD_TO_DATE(INCR_LOAD_START_TIME,'DD',1),'DD')>NBR_INCREMENT_DAYS+7,TRUNC(ADD_TO_DATE(ADD_TO_DATE(TRUNC(SYSDATE),'SS',-1),'DD',-NBR_INCREMENT_DAYS+1)),
				(IIF(LOAD_IND = 'S' and TRUNC(PROCESS_START_TIME) != TRUNC(SYSDATE), ADD_TO_DATE(:LKP.LKP_PROCESS_BATCH_CONTROL_ROLLING(PROCESS_NAME,'C'),'DD',1),INCR_LOAD_START_TIME))
				)
			))
		)))
	)
